import Layout from '../components/MyLayout.js'
import styled from "styled-components";
const Bound = styled.div`
    display: flex;
    flex: 1;
`;
const MainUsers = () => {

    return (
        <Layout>
            <Bound>
                <p>Users Page.</p>
                <div className='main-table-user'>

                </div>
            </Bound>

        </Layout>
    )
}

export default MainUsers
